import React, {Component} from 'react';
import { Carousel } from 'antd';
import {Link} from "react-router-dom";
//引入样式
import './product-list.scss';
import '../../publicstyle/publicstyle.css';
import Axios from "axios";
class Plist extends Component {
    state={
        data:[]
    }
    componentDidMount(){
        Axios.get("http://47.100.98.54:9019/api/category").then((res)=>{
            console.log(res.data.data)
            this.setState({
                data:res.data.data
            })
        })
    }

    render() {
        return (
            <div className="shop-banner">
                    {/*引入轮播图组件*/}
                    <Carousel effect="fade">
                        {/*第一页*/}
                        <ul className="shop-list">
                            {this.state.data.length>0&&this.state.data.map((item,index)=>{
                                <li key={index}>
                                    <Link to='/productlist/list1'>
                                        <img src={require("../../static/img/shopbanberimg/5.webp")} alt="美食"/>
                                        <p >美食</p>
                                    </Link>
                                </li>
                            })}

                            {/*<li>*/}
                                {/*<Link to='/productlist/list2'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/4.webp")} alt="商超便利"/>*/}
                                    {/*<p >商超便利</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list3'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/3.webp")} alt="午餐"/>*/}
                                    {/*<p >午餐</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list4'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/10.webp")} alt="水果"/>*/}
                                    {/*<p >水果</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list5'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/6.webp")} alt="医疗健康"/>*/}
                                    {/*<p >医疗健康</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list6'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/9.webp")} alt="浪漫鲜花"/>*/}
                                    {/*<p >浪漫鲜花</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list7'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/7.webp")} alt="厨房生鲜"/>*/}
                                    {/*<p >厨房生鲜</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list8'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/8.webp")} alt="跑腿代购"/>*/}
                                    {/*<p >跑腿代购</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list9'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/9.webp")} alt="地方小吃"/>*/}
                                    {/*<p >地方小吃</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}
                            {/*<li>*/}
                                {/*<Link to='/productlist/list10'>*/}
                                    {/*<img src={require("../../static/img/shopbanberimg/8.webp")} alt="签到领红包"/>*/}
                                    {/*<p >签到领红包</p>*/}
                                {/*</Link>*/}
                            {/*</li>*/}

                        </ul>
                        {/*第二页*/}
                        <ul className="shop-list">
                            <li>
                                <Link to='/productlist/list11'>
                                    <img src={require("../../static/img/shopbanberimg/11.webp")} alt="地方菜系"/>
                                    <p >地方菜系</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/productlist/list12'>
                                    <img src={require("../../static/img/shopbanberimg/12.webp")} alt="地方菜系"/>
                                    <p >麻辣烫</p>
                                </Link>
                            </li>
                        </ul>

                    </Carousel>

            </div>
        );
    }
}

export default Plist;
